#' \mjsdeqn{T_d = T - 20 (1-H_R)}
#' where
#'   - \mjseqn{\alpha} is albedo, `land_albedo_1`
#'   - \mjseqn{z} is elevation, `land_elevation_m`
#'   - \mjseqn{T_d} is dewpoint temperature,
